//FUNCTION LIBRARY (v0.3) -- THESE FUNCTIONS HAVE BEEN MINIFIED.
//FOR FULL DOCUMENTAITON AND A CURRENT COPY, SEE THE ACTION "(vX.X) FUNCTION_LIBRARY"
//(truncated version with only the relevant functions)
function now(){return(new GlideDateTime).getNumericValue()}function insertOrUpdate(e){var a={},i=now();null==e.unique_pairs&&(e.unique_pairs=[]);try{var r=new GlideRecord(e.table);if(0!=e.unique_pairs.length){for(var t=0;t<e.unique_pairs.length;t++)r.addQuery(e.unique_pairs[t][0],e.unique_pairs[t][1]);r.query()}if(0==r.getRowCount()){r.initialize();for(t=0;t<e.unique_pairs.length;t++)r[e.unique_pairs[t][0]]=e.unique_pairs[t][1];for(t=0;t<e.update_pairs.length;t++)r[e.update_pairs[t][0]]=e.update_pairs[t][1];r.insert(),a.operation="insert"}else{for(t=0;t<e.update_pairs.length;t++)r[e.update_pairs[t][0]]=e.update_pairs[t][1];r.updateMultiple(),a.operation="update"}}catch(e){a.operation="error: "+e}return a.time_delta=now()-i,a}function setCacheValue(e,a,i){var r={table:"x_fmcna_armis_inte_armis_integration_cache"};switch(r.unique_pairs=[["key",e]],i){case"str":r.update_pairs=[["value_string",a]];break;case"int":r.update_pairs=[["value_int",a]];break;case"datetime":r.update_pairs=[["value_datetime",a]]}return insertOrUpdate(r)}

(function execute(inputs, outputs) {
  var value
  switch (inputs.type) {
    case 'int': value = inputs.int;break
    case 'str': value = inputs.str;break
    case 'datetime' : value = inputs.datetime;break
  }
  outputs.return = setCacheValue(inputs.cache_key,value,inputs.type)
})(inputs, outputs);

